import { DefaultTheme } from "styled-components";

export const darkTheme: DefaultTheme = {
  bgColor: "#3F8CF2",
  textColor: "#f5f6fa",
  accentColor: "9c88ff",
  boardColor: "#DADFE9",
  cardColor: "white",
};

export const lightTheme: DefaultTheme = {
  bgColor: "whitesmoke",
  textColor: "black",
  accentColor: "9c88ff",
};
